import React from 'react';
import './realEstat.module.css'
class RealEstat extends React.Component {
  State={
reats:[]
  }
  constructor(props)  
       {
        let rate=0;
        let rates=[];
        if(props.item.airbnb_ROI==null&&props.item.traditional_ROI==null){
            rate=0;
          }
          else if(props.item.airbnb_ROI==null){
            rate=props.item.traditional_ROI
          }
          else if(props.item.traditional_ROI==null){
            rate=props.item.airbnb_ROI
          }
          else{
            rate=(props.item.airbnb_ROI+props.item.traditional_ROI)/2
          }
          for (let index = 0; index < 5; index++) {
            if (index<rate) {
              rates.push(1);
            }
            else{
              rates.push(0);
            }
      
          }
          this.setState={
            reats:rates
          }
        
        }
    
      
    
    

  
    render() {
      
            return (
            <div>
                <div className="contanir">
                 <div className="img">
                   
                    <div className="basic-info">
                        <span style={{marginLeft:"3%" }}>{this.props.item.beds} BDS | {this.props.item.baths} ba | {this.props.item.sqft} sqr</span>
                        <span style={{float:"right",marginRight: "3%"}}>{this.props.item.list_price}$</span>
                    </div>
                    </div>
                    <div className="data-section">
                            <div className="location">
                                <span className="loc">{this.props.item.address}</span>
                                <span className="stars">
                                <span>
                                    {this.state.rates.map((R)=>{
                                        if (R==1){
                                            <span className=" fas fa-star">****************</span>
                                        }
                                        if(R==0){
                                            <span className=" far fa-star">--------------</span>

                                        }
                                    })}
                                </span>
                                </span>
                         </div>
                            <div className="comparison-section">
                                         <div>hr</div>
                                 <div className="compare">
                                    <div className="row">
                                        <div className="col-3 offset-6 fontstyling">Airbnb</div>
                                        <div className="col-3 fontstyling">Trad.</div>
                                    </div>
                                    
                                </div>

                 </div>
             </div>
             </div>
             </div>
            );
    }
  }


  
  export default RealEstat;
